import React from 'react'

export default function Footer() {
  return (
    <div className="w-full">
      {/* Image at the top of the footer */}
      <img 
        src="/foot.png" 
        alt="Footer Top Decoration" 
        className="w-full h-auto"
      />

      {/* Footer Content on brown background */}
      <section className="w-full bg-[#302019] py-12">
        <div className="max-w-7xl mx-auto px-6 text-white">
          <h2 className="text-2xl font-semibold mb-4">Footer Heading</h2>
          <p className="text-base">This is your footer content. Add links, contact info, etc. here.</p>
        </div>
      </section>
    </div>
  )
}
